	(1, 'Que en virtud de las Resoluciones No. 009 del 15 de enero de 2020 el señor Rector de la Universidad Distrital Francisco José de Caldas delega en el Decano de la Facultad de Medio Ambiente y Recursos Naturales la ordenación del gasto y la contratación para el rubro de Practicas Académicas Facultad del Medio Ambiente.', 'Que mediante Resolución del Consejo Superior Universitario No. 004 del 4 de marzo de 2003, se establecen las escalas salariales de las distintas categorías de empleos de la Universidad Distrital Francisco José de Caldas y se dictan otras disposiciones.', 'Que en el artículo cuarto de la Resolución de la Rectoría No. 311 del 25 de junio de 2019, se establece que: “para la realización de prácticas académicas, a los docentes de carrera y de vinculación especial, sólo se les podrán reconocer viáticos, a 31 de diciembre de 2003, hasta por el valor de SESENTA Y CINCO MIL PESOS ($65.000) MC/TE por día pernoctado. Dicha suma, se reajustará anualmente en un porcentaje igual al incremento del índice de Precios al Consumidor (1.P.C.) Nacional, que registre el DANE a 31 de diciembre de cada', 'Que mediante Resolución de Rectoría No. 311 del 25 de junio de 2019, se reglamenta el procedimiento general de solicitud de los avances, aprobación, desembolso y su correspondiente legalización en la Universidad.', 'Que en el artículo tercero de la Resolución de Rectoría No. 311 del 25 de junio de 2019, se establecen las modalidades de avances.', 'Que en el artículo primero del Acuerdo 012 del 24 de octubre de 2019 el Consejo Superior modificó el Artículo del Acuerdo No. 010 de 1988, en el cual determinó que:', '"ARTÍCULO 2°. Los estudiantes que deban realizar prácticas académicas fuera de la ciudad de Bogotá en el territorio Nacional, según la normatividad interna, recibirán un auxilio económico equivalente al valor de uno punto dos (1.2) Salarios Mínimos Diarios Legales Mensuales Vigentes —SMDLV, cuando la práctica sea por un solo  día.', 'En el caso que las prácticas sean por dos (2) o más días, los estudiantes recibirán un auxilio económico equivalente al valor de uno punto ocho 0.8) Salarios Mínimos Diarios Legales Mensuales Vigentes —SMDLV, por cada uno de los días de práctica académica"', 'Que se hace necesario autorizar el trámite de un avance a la División Financiera de la Universidad Distrital Francisco José de Caldas, y así mismo el manejo y ejecución del mismo a un docente de  la una actividad académica.', 'Que los planes de prácticas de los diferentes Proyectos Curriculares adscritos a la Facultad del Medio Ambiente y Recursos Naturales se aprobaron por el Consejo de Facultad mediante sesión del', NULL, '** El viático de cada docente es de  (el número de días – 0.5)  * $', 'El auxilio de cada estudiante  para prácticas de un día cuyo destino es fuera de la ciudad de Bogotá es de $', 'El auxilio diario de cada estudiante  para prácticas de más de un día cuyo destino es fuera de la ciudad de Bogotá  es de $', 'Que el Decano de la Facultad del Medio Ambiente y Recursos Naturales en uso de sus facultades legales y especialmente las contempladas en el Articulo 91 del Acuerdo 11 de 2002, literal e, concede comisión para adelantar actividades relacionadas con su actividad académica al (los) docente(s) que participara(n) en la(s) práctica(s) académica(s) descrita es este acto administrativo', 'Delegar al citado docente para el manejo y legalización de los recursos entregados', 'La presente Resolución rige a partir de la de fecha de su expedición.');
/*!40000 ALTER TABLE `resolucion` ENABLE KEYS */;

